import {Image} from "primereact/image";

export function Preview(attr) {
    return (
        <div className={"flex flex-column p-2"} key={attr.key}>
            <div className="flex">
                <img src={`https://image.tmdb.org/t/p/original/${attr.id}`}  alt={attr.title}/>
                <Image src="/images/galleria/galleria7.jpg" alt="Image" width="250" />

            </div>
            <div className="flex">
                <p>{attr.title}</p>
            </div>
        </div>
    )
}
